import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faExchangeAlt, faTable } from '@fortawesome/free-solid-svg-icons'
//import Converter from './Converter';
//import Rates from './Rates';
import './App.css';

const NotFound = () => {
  return <h2>404 Not Found</h2>;
}

const App = () => {
  return (
    <Router>
      <div className="background">
        <nav className="navbar navbar-expand-lg navbar-dark pt-5">
          <div className="container pb-3 container-navbar">
            <Link className="navbar-brand" to="/">
              <h1>Currency Exchange</h1>
            </Link>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse justify-content-end" id="navbarNavDropdown">
              <ul className="navbar-nav">
                <li className="nav-item pr-4">
                  <Link className="nav-link d-flex pr-4" to="/converter/">
                    <span><FontAwesomeIcon icon={faExchangeAlt} size="lg" /></span>
                    <h4 className="mb-0 mx-2">Convert</h4>
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link d-flex" to="/rates/">
                  <span><FontAwesomeIcon icon={faTable} size="lg" /></span>
                    <h4 className="mb-0 mx-2">Rates</h4>
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </div>

    </Router>
  );
}

export default App;
